import React from "react";
import { Handle } from 'react-flow-renderer';

const RectangleNode = ({ data }) => {
    return (
      <div style={{ background: "#9ca8b3", padding: "14px" }}>
        <Handle
          type="target"
          position="left"
          id={`${data.id}.left`}
          style={{ borderRadius: 0 }}
        />
        <div id={data.id}>{data.label}</div>
        <Handle
          type="source"
          position="right"
          id={`${data.id}.right1`}
          style={{ top: "30%", borderRadius: 0 }}
        />
        <Handle
          type="source"
          position="right"
          id={`${data.id}.right2`}
          style={{ top: "70%", borderRadius: 0 }}
        />
      </div>
    );
};

const CircleNode = ({ data }) => {
    return (
      <div
        style={{
          backgroundColor: "#9ca8b3",
          padding: "14px",
          borderRadius: "50px"
        }}
      >
        <Handle
          type="target"
          position="left"
          id={`${data.id}.left`}
          style={{ borderRadius: "0" }}
        />
        <div id={data.id}>{data.label}</div>
        <Handle
          type="source"
          position="right"
          id={`${data.id}.right1`}
          style={{ top: "30%", borderRadius: 0 }}
        />
        <Handle
          type="source"
          position="right"
          id={`${data.id}.right2`}
          style={{ top: "70%", borderRadius: 0 }}
        />
      </div>
    );
};

const TriangleNode = ({ data }) => {
    return (
      <div>
        <div className="triangle-node-right">
        <Handle
          type="target"
          //position="top"
          id={`${data.id}.top`}
          style={{top: '75px', borderRadius: 0 }}
        />
        <div id={data.id} className="triangle-node-text">
          {data.label}
        </div>
      </div>

      <div className="triangle-node-left">
        <div id={data.id} className="triangle-node-text">
          {data.label}
        </div>
      </div>

        <div className="rect-node-top"></div>
        <div className="rect-node-center">
      </div>
    </div>
  );
};

export const TextNode = ({ data }) => {
    return (
      <div style={{ background: "transparent", padding: "14px" }}>
        <div id={data.id}>{data.label}</div>
      </div>
    );
};

export const nodeTypes = {
    circle: CircleNode,
    rectangle: RectangleNode,
    triangle: TriangleNode,
    text: TextNode
};
